import React, { Component } from 'react';
import { Tabs, Tab } from '@blueprintjs/core';
import EmployeeCard from './EmployeeCard';
import RolesCard from '../Roles/RolesCard';
import LanguagesCard from '../Languages/LanguagesCard';

export default class Employees extends Component {
   state = {
      activeTabID: 1
   };
   handleTabChange = TabId => this.setState({ activeTabID: 1 });
   render() {
      return (
         <Tabs onchange={this.handleTabChange} large>
            <Tab id='1' title='Employees' panel={<EmployeeCard />} />
            <Tab
               id='2'
               title='Employees Types'
               panel={<div>EmployeesTypes</div>}
            />
         </Tabs>
      );
   }
}
